// ProjectCard.js
import React from 'react';

export const ProjectCard = ({ title, description, imgUrl, link }) => {
  return (
    <div className="project-card">
      <a href={link} target="_blank" rel="noopener noreferrer">
        <img src={imgUrl} alt={title} />
        <h3>{title}</h3>
        <p>{description}</p>
      </a>
    </div>
  );
};
